import React,{ useState } from "react";
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import 'react-datepicker/dist/react-datepicker.css';
import DatePicker from 'react-datepicker';

//ADD VALIDATION TO THESE FIELDS AND THROW ERRORS


const Seller =()=>{
    const [startDate, setStartDate] = useState(new Date());


    return(
        <div className="introTag">
            <h1 style={{marginTop:"100px"}}>Hi post listing</h1>
            <Form>
                {/* Name Field */}
                <Form.Group className="mb-3" controlId="formBasicName">
                    <Form.Label>Name</Form.Label>
                    <Form.Control type="text" placeholder="Enter name" />
                </Form.Group>

                {/* Email Field */}
                <Form.Group className="mb-3" controlId="formBasicEmail">
                    <Form.Label>Email Address</Form.Label>
                    <Form.Control type="email" placeholder="Enter email" />
                    <Form.Text className="text-muted">
                    We'll never share your email with anyone else.
                    </Form.Text>
                </Form.Group>

                {/* Departure City Field */}
                <Form.Group className="mb-3" controlId="formBasicDepartureCity">
                    <Form.Label>Departure City</Form.Label>
                    <Form.Control type="text" placeholder="Enter departure city" />
                </Form.Group>

                {/* Destination Field */}
                <Form.Group className="mb-3" controlId="formBasicDestination">
                    <Form.Label>Destination</Form.Label>
                    <Form.Control type="text" placeholder="Enter destination" />
                </Form.Group>

                {/* Date Field */}
                <Form.Group className="mb-3" controlId="formBasicDate">
                    <Form.Label>Date</Form.Label>
                    <DatePicker
                    selected={startDate}
                    onChange={(date) => setStartDate(date)}
                    className="form-control"
                    />
                </Form.Group>
                {/* Time Field */}
                <Form.Group className="mb-3" controlId="formBasicTime">
                    <Form.Label>Time</Form.Label>
                    <Form.Control type="time" />
                </Form.Group>

                {/* Available Space Field */}
                <Form.Group className="mb-3" controlId="formBasicAvailableSpace">
                    <Form.Label>Available Space</Form.Label>
                    <Form.Control type="text" placeholder="Enter available space" />
                </Form.Group>

                {/* Asking Price Field */}
                <Form.Group className="mb-3" controlId="formBasicAskingPrice">
                    <Form.Label>Asking Price</Form.Label>
                    <Form.Control type="text" placeholder="Enter asking price" />
                </Form.Group>

                {/* Additional Information Field */}
                <Form.Group className="mb-3" controlId="formBasicAdditionalInfo">
                    <Form.Label>Anything that Buyer Should Know?</Form.Label>
                    <Form.Control as="textarea" rows={3} placeholder="Enter additional information" />
                </Form.Group>

                {/* Submit Button */}
                <Button variant="primary" type="submit">
                    Post My Listing
                </Button>
            </Form>

        </div>
    );
}

export default Seller;
